webpackJsonp([0xd5adf0982299],{360:function(e,t){e.exports={data:{post:{html:'<h1 id="administration"><a href="#administration" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Administration</h1>\n<p>Parce que chaque Junior-Entreprise est unique, Jeyser est configurable pour correspondre à vos besoins.</p>\n<h3 id="gestion-des-documents-types"><a href="#gestion-des-documents-types" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Gestion des documents types</h3>\n<p>Depuis l\'espace admin, vous pouvez importer et mettre à jour vos /docs/features-fr/documents-types.</p>\n<p>Pour plus de précisions, consultez la <a href="documents-types">page dédiée aux documents types</a>.</p>\n<h3 id="roles-et-utilisateurs"><a href="#roles-et-utilisateurs" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Roles et utilisateurs</h3>\n<p>Les administrateurs peuvent gérer les membres et leurs permissions sur Jeyser.</p>\n<p>Les rôles disponibles sont les suivants : </p>\n<ul>\n<li>ROLE_SUPERADMIN : Role donné au premier utilisateur créé automatiquement à l\'installation. Un SuperAdmin à accès à un panneau de gestion de la base de données permettant de modifier les données brutes. A réserver aux membres du Pole DSI expérimentés. Englobe tous les roles.</li>\n<li>ROLE_ADMIN : Permet de gérer les documents types, les utilisateurs, de modifier les paramètres de Jeyser. Englobe les roles CA, SUIVEUR, ELEVE. N\'a pas accès à la trésorerie.</li>\n<li>ROLE_CA : Permet de consulter les statistiques et les études confidentielles. Contrairement à ce que suggère le nom, nous vous conseillons de ne donner ce rôle qu\'aux membres de votre bureau. Englobe les roles SUIVEUR et ELEVE.</li>\n<li>ROLE_TRESO : Permet d\'éditer les factures, les BV. Englobe le role ELEVE.</li>\n<li>ROLE_SUIVEUR : Permet d\'accéder aux études et aux membres de l\'association. Englobe le role ELEVE.</li>\n<li>ROLE_ELEVE : Permet d\'accéder à sa fiche personnelle. Nous vous déconseillons fortement d\'ouvrir un compte Jeyser pour chacun de vos membres.</li>\n</ul>\n<p> <strong>Note :</strong> Un role a toutes les permissions des roles englobés.</p>\n<p> <strong>Rappel :</strong> Vous pouvez ouvrir un compte utilisateur à un de vos membre depuis sa fiche. Il recevra un mail avec la procédure d\'activation. </p>\n<h3 id="importation-de-données-externes"><a href="#importation-de-donn%C3%A9es-externes" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Importation de données externes</h3>\n<p>Jeyser contient un système ouvert d\'importation de données. Vous pouvez par ce moyen importez des données depuis es sources externes.</p>\n<p>Pour le moment la seule source de donnée externe valide est l\'export Siaje. Lorsque vous résiliez votre contrat Siaje, un export de votre base de données (</p>\n<h3 id="paramètres"><a href="#param%C3%A8tres" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Paramètres</h3>\n<p>Comme précisé dans la partie <a href="/docs/features-fr/gestion-associative">Gestion Associative</a>, vous pouvez créer vos postes et vos filières depuis l\'espace d\'admin. Vous pouvez aussi y définir vos domaines de compétences.</p>\n<p>Enfin, depuis la version 2.0.0 de jeyser, vous configurer depuis le web les paramètres de votre junior tels son Nom, son adresse, les noms des trésoriers et président à mettre en fin de documents types ...</p>'},navDoc:{edges:[{node:{title:"Installation",path:"install",items:[{id:"environment",title:"Environment",anchors:null},{id:"index",title:"Install Jeyser in minutes",anchors:null},{id:"update",title:"Update Jeyser",anchors:null},{id:"annexes",title:"Annexes",anchors:[{id:"help-for-manual-installation",title:"Help for manual installation"},{id:"ssh-key-connection",title:"SSH Key Connection"}]}]}},{node:{title:"Features",path:"features-fr",items:[{id:"gestion-associative",title:"Gestion associative",anchors:null},{id:"suivi-projet",title:"Suivi de projet",anchors:null},{id:"prospection",title:"Prospection",anchors:null},{id:"rh",title:"Relations humaines",anchors:null},{id:"tresorerie",title:"Trésorerie",anchors:null},{id:"formations",title:"Formations",anchors:null},{id:"indicateurs",title:"Indicateurs",anchors:null},{id:"documents-types",title:"Documents types",anchors:null},{id:"documents-types-faq",title:"FAQ Documents types",anchors:null},{id:"administration",title:"Administration",anchors:null},{id:"gdpr",title:"Règlement général sur la protection des données",anchors:null}]}},{node:{title:"User guides",path:"user-guides",items:[{id:"introduction-to-jeyser-1",title:"Introduction to Jeyser",anchors:null}]}},{node:{title:"Development",path:"dev",items:[{id:"faq",title:"FAQ",anchors:null},{id:"docker-architecture",title:"Architecture Docker",anchors:null},{id:"about",title:"About",anchors:null},{id:"demo-data",title:"Demo data",anchors:null},{id:"contributing",title:"Contributing",anchors:null}]}}]}},pathContext:{path:"docs/features-fr/administration",current:{path:"docs/features-fr/administration",title:"Features - Administration"},prev:{path:"docs/features-fr/documents-types-faq",title:"FAQ Documents types",rootPath:"Features"},next:{path:"docs/features-fr/gdpr",title:"Règlement général sur la protection des données",rootPath:"Features"}}}}});
